import React from "react";
import LoginForm from "./LoginForm";
import { reduxForm } from "redux-form";

const Login = () => {
    return (
        <div>
            <h1>Login</h1>
            <LoginReduxForm  />
        </div>
    )
}

const LoginReduxForm = reduxForm({form: 'login'}) (LoginForm)

export default Login
